const std::vector<std::string>& wbt::word_list_alphabetic() {
    static std::vector<std::string> alphabetic_word_list;
    if (alphabetic_word_list.empty()) {
        alphabetic_word_list = word_list |
            rv::transform(
                [](const auto& pair) {
                    return std::get<0>(pair);
                }
        ) | r::to_vector;
    }
    return alphabetic_word_list;
}

const std::vector<std::string>& wbt::word_list_by_score() {
    static std::vector<std::string> by_score_word_list;
    if (by_score_word_list.empty()) {
        auto score_to_word = word_list |
            rv::transform(
                [](const auto& pair)->std::multimap<double, std::string>::value_type {
                    const auto& [word, score] = pair;
                    return { score,word };
                }
        ) | r::to<std::multimap<double, std::string>>();

        by_score_word_list = score_to_word |
            rv::transform(
                [](const auto& item) {
                    return item.second;
                }
        ) | 
        rv::reverse |
        r::to_vector;
    }

    return by_score_word_list;
}

const std::unordered_map<std::string, double>& wbt::word_score_table() {
    static std::unordered_map<std::string, double> tbl;
    if (tbl.empty()) {
        tbl = word_list |
            rv::transform(
                [](const auto& pair)->std::unordered_map<std::string, double>::value_type {
                    const auto& [word, score] = pair;
                    return { word, score };
                }
        ) | r::to<std::unordered_map<std::string, double>>();
    }
    return tbl;
}